وعزفت "أوركسترا لندن المعاصرة" أمام الجمهور مباشرة ألحان الفيلم السعودي "جود"، من انتاج مركز الملك عبد العزيز الثقافي العالمي "إثراء"، ويوثق لسخاء وعطاء الإنسان السعودي، وأبرز مشاهد الحياة في المملكة، وما شهدته من تطور مدني بعد اكتشاف النفط.

@FilmMOC
@KSAExpo2020 
@expo2020dubai https://t.co/Tg0sfarS28

وأعرب آل عياف خلال الحفل عن اعتزازه بتجربة "ليالي الفيلم السعودي"، لافتاً إلى أن الفعالية ستشهد ورش عمل وحلقات نقاش وعروضاً تفاعلية ولقاءات فنية وندوات سينمائية، ستلقي الضوء على فنون الصناعة ومستقبل السينما السعودية الواعدة.

@FilmMOC
@KSAExpo2020 
@expo2020dubai https://t.co/NvR0PVvJDC

وأشار إلى أن هيئة الأفلام تتولى تقديم برامج لتنمية المواهب السينمائية الشابة، وتعمل على خلق فرص التبادل، وبناء شراكات محلية ودولية مع المؤسسات والخبراء الرائدين في هذه الصناعة، من أجل تطوير المشهد السينمائي الواعد.

@FilmMOC
@KSAExpo2020 
@expo2020dubai https://t.co/Xpi4zBLnIC

وأكد آل عياف أن المملكة، بدعم من رؤية 2030، تشهد نهضة ثقافية واسعة تشجع وتحفز على الإبداع وترعى المواهب، مشيراً إلى أن ما تشهده المملكة حالياً من نمو غير مسبوق في صناعة السينما يتيح إقامة شراكات مثمرة، ويسهم في فتح فرص استثمارية كبيرة.

@FilmMOC
@KSAExpo2020 
@expo2020dubai https://t.co/Rnc2S0qh4R

